import React, { useState } from 'react';
import { SearchIcon } from '../../asset/icons/search/index.js';

const Search = () => {
  const [search, setSearch] = useState('');

  const handleChange = (e) => {
    setSearch(e.target.value);
  };

  return (
    <div className="relative bg-tertiary h-12 w-80 rounded-xl">
      <input 
        className="h-full w-full rounded-xl pl-4 pr-10 text-sm focus:outline-none"
        type="text" 
        placeholder="Explore new restaurants" 
        value={search} 
        onChange={handleChange} 
      />
      <div className="absolute right-3 top-1/2 transform -translate-y-1/2">
        <SearchIcon />
      </div>
    </div>
  );
};

export default Search;
